import React, { Component } from 'react';
import './trailer.css';

class trailer extends Component{
    constructor(props) {
        super(props);
        this.state = {
            video: './dummy.mov'
        };
    }

    render(){
        return(
            <section className="trailer-wrapper">
                <video className="trailer" src={this.state.video}>
                </video>
            </section>
        );
    }

}

export default trailer;
